import { jsPDF } from 'jspdf'

const bulkPdfGenerator = (records, type = '') => {
  // const [currentAdmin] = useCurrentAdmin();
  // const { params,populated} = records
  // let { income} = populated
  //  income = income.params
  // console.log(records)
  var bulkbg = 'data:image/png;base64,'
  const doc = new jsPDF()
  // records.forEach(element => {
  // });



  doc.addImage(bulkbg, 'PNG', 0, 0, 210, 260)
  var yHeight = 70;
  for (let index = 0; index < records.length; index++) {
    let clientParam = records[index].params
    // console.log(clientParam);
    doc.setFontSize(10)
    doc.text(clientParam.Name, 40, yHeight)
    doc.text(clientParam.CNIC, 60, yHeight)
    doc.text(clientParam.Contact, 100, yHeight)
    doc.text(clientParam.Passport_number, 140, yHeight)
    yHeight += 10
  }


  const filename = `/${type}bulkPdf.pdf`
  doc.save(`./pdfs${filename}`)


  const fileurl = `./pdfs${filename}`

  return filename
}

export default bulkPdfGenerator